import React,{Component} from 'react';
import './App.css';
import axios from 'axios';

class App extends Component {

  componentDidMount(){
    const userObject = {
      userName : 'Dobri',
      email : "dobrganch89@gmail.com",
      password : "France123",
      confirmPassword : "France123"
    };
    axios.post('http://127.0.0.1:5000/employees/signup',userObject)
      .then((res) => {
        console.log(res.data)
      }).catch((error) => {
        console.log(error);
      })
  }

  render(){
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
